import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import dayjs from "dayjs";

const Profile = () => {
  const [items, setItems] = useState([]);
  const [user, setUser] = useState(null);
  const [drivers, setDrivers] = useState([]);
  const [selectedDriver, setSelectedDriver] = useState("");
  const apiUrl = "https://bam-app-489c6c1370a9.herokuapp.com";

  useEffect(() => {
    const fetchData = async () => {
      try {
        const username = localStorage.getItem("username");
        setUser(username);

        const response = await axios.get(`${apiUrl}/api/data`);
        const userItems = response.data.filter(
          (item) => item.user === username
        );
        setItems(userItems);

        // Получаем список уникальных водителей, проверяя, что это строка
        const uniqueDrivers = [
          ...new Set(
            userItems
              .map((item) => item.driver)
              .filter(
                (driver) => typeof driver === "string" && driver.trim() !== ""
              )
          ),
        ];
        setDrivers(uniqueDrivers);
      } catch (error) {
        console.error("Ошибка при загрузке данных:", error);
      }
    };

    fetchData();
  }, []);

  if (!user) {
    return <p>Загрузка...</p>;
  }

  // Фильтруем заявки по выбранному водителю
  const filteredItems = selectedDriver
    ? items.filter((item) => item.driver === selectedDriver)
    : items;

  return (
    <div>
      <Link to="/">
        <button>Go to Home</button>
      </Link>
      <h1>Профиль пользователя: {user}</h1>

      {/* Инпут для выбора водителя */}
      <div>
        <label htmlFor="driver">Выберите водителя:</label>
        <select
          id="driver"
          value={selectedDriver}
          onChange={(e) => setSelectedDriver(e.target.value)}
        >
          <option value="">Все водители</option>
          {drivers.map((driver, index) => (
            <option key={index} value={driver}>
              {driver}
            </option>
          ))}
        </select>
      </div>

      {/* Отображаем отфильтрованные элементы */}
      <div>
        <h2>Заявки выбранного водителя:</h2>
        {filteredItems.length > 0 ? (
          <ul>
            {filteredItems.map((item) => (
              <li key={item._id}>
                <strong>Водитель:</strong> {item.driver || "Без водителя"}
                <br />
                <strong>Бренд:</strong> {item.brand || "Без имени"}
                <br />
                <strong>Цена:</strong> {item.price || "Цена не указана"}
                <br />
                <strong>calcPay:</strong> {item.calcPay || "Без calcPay"}
                <br />
                <strong>Номер автомобиля:</strong>{" "}
                {item.vehicleNumber || "Без номера автомобиля"}
                <br />
                <strong>Дата:</strong>{" "}
                {dayjs(item.date).format("YYYY-MM-DD") || "Без даты"}
              </li>
            ))}
          </ul>
        ) : (
          <p>Нет заявок для отображения.</p>
        )}
      </div>
    </div>
  );
};

export default Profile;
